  if (ruleFile == null) {
    throw new IllegalArgumentException("Rule file cannot be null!");
  }

  properties = new Properties();
  try (InputStream is = new FileInputStream(new File(ruleFile))) {
    properties.load(is);
  }
  actions = new HashMap<>();
  initPropertyActions();
}
